INSERT INTO `message` VALUES (43,23,1,'Привет!!','2014-01-17 15:32:12'),(44,23,1,'Че как дела?','2014-01-17 15:32:20'),(45,23,1,'Ауууу!! ты чего молчишь то? неужели нечего сказать? ну ясно понятно все. Я тогда тоже буду молчать =) как рыба. Хотя быть может рыба не говорит потому что под водой нельзя говорить? интересно, получается первые существа, появившиеся на суше, тоже не могли говорить. А у кого первого появились голосовые связки? и какой был первый произнесенный звук на планете? =)','2014-01-17 15:34:01'),(46,23,1,'Погода отличная =) люблю снег','2014-01-17 15:36:44'),(47,24,30,'ПРивет, Артем2','2014-01-17 15:38:20'),(48,23,30,'Ясно понятно','2014-01-17 15:38:45'),(49,23,1,'Вкусная еда - это хорошо!!','2014-01-17 16:06:26'),(50,23,30,'Привет, Илья. Как твои дела? Давно не писал тебе. Спешу тебя обрадовать. Зима не будет.','2014-01-17 16:32:10'),(51,25,26,'Привет =)','2014-01-20 12:23:51'),(52,26,1,'123','2014-01-21 20:23:35'),(53,27,1,'Привет, дружище','2014-01-23 12:51:40'),(54,23,1,'Ясно =) спасибо за хорошие новости =)\r\nПРоверяю перенос строки','2014-01-31 12:51:48'),(55,23,1,'<a href=\"#\">ссылки</a>','2014-01-31 12:52:13'),(56,23,1,'<script>alert(\'test\');</script>','2014-01-31 12:52:32'),(57,28,33,'Йо!! ЧЕ делаешь? О_о','2014-02-03 14:38:42'),(58,27,1,'ПРивет!!','2014-02-04 11:23:12'),(59,27,1,'Привет','2014-02-27 16:41:19');
