INSERT INTO `support` VALUES (1,'Илья Шихалеев','ilya.shikhaleev@cpslabs.net','Привет!! \r\nОчень нравится ваш проект, безумно удобный и полезный!!\r\nМои дети постоянно смотрят ваши видео уроки, даже телевизор им больше не интересен.\r\nХочу выразить огромную благодарность команде разработчиков за столь замечательный сайт!!\r\nУдачи и успехов вам во всем!!\r\n\r\nС уважением, \r\nИлья Анатольевич',1,'2014-03-31 09:52:12'),(2,'Илья Шихалеев','ilya.shikhaleev@cpslabs.net','В центральном матче 23-го тура СОГАЗ-Чемпионата России по футболу в Москве встречались «Локомотив» и «Спартак».\r\n\r\nМатч завершился вничью – 0:0.\r\n\r\n«Локомотив» вернулся на первое место в турнирной таблице, а в составе «Спартака» впервые после долгого перерыва сыграли Дикань и Брызгалов.',1,'2014-03-31 10:25:27'),(3,'Илья Шихалеев','ilya.shikhaleev@cpslabs.net','В центральном матче 23-го тура СОГАЗ-Чемпионата России по футболу в Москве встречались «Локомотив» и «Спартак».\r\n\r\nМатч завершился вничью – 0:0.\r\n\r\n«Локомотив» вернулся на первое место в турнирной таблице, а в составе «Спартака» впервые после долгого перерыва сыграли Дикань и Брызгалов.',1,'2014-03-31 10:28:04'),(4,'Илья Шихалеев','ilya.shikhaleev@cpslabs.net','В центральном матче 23-го тура СОГАЗ-Чемпионата России по футболу в Москве встречались «Локомотив» и «Спартак».\r\n\r\nМатч завершился вничью – 0:0.\r\n\r\n«Локомотив» вернулся на первое место в турнирной таблице, а в составе «Спартака» впервые после долгого перерыва сыграли Дикань и Брызгалов.',1,'2014-03-31 10:28:10'),(5,'21','1','1',1,'2014-03-31 10:32:01'),(6,'Илья','ilya@mail.ru','В Казани в матче 23-го тура СОГАЗ-Чемпионата России по футболу «Рубин» принимал «Ростов».\r\n\r\nМатч завершился победой команды Миодрага Божовича – 2:1.\r\n\r\nВ первом тайме счет открыл Азмун, Калачев восстановил равенство, а в самом конце Ананидзе вывел свою команду вперед.\r\n\r\nНа этом матче Российская футбольная Премьер-Лига совместно с ФК \"Рубин\" провели очередную акцию в рамках социального проекта \"Лига Добрых Сердец\" для воспитанников Республиканской специальной общеобразовательной школы (РСОШ). Дети побывали на \"Казань-Арене\", где для них была проведена экскурсия. Также они побывали на базе \"Рубина\", где встретились с игроками казанского клуба Русланом Мухаметшиным и Максимом Жестоковым. Футболисты вручили воспитанникам РСОШ шарфы с символикой \"Рубина\", а также посетили матч «Рубин» - «Ростов».',1,'2014-03-31 11:16:20'),(7,'Илья Шихалеев','ilya.shikhaleev@cpslabs.net','В матче 23-го тура СОГАЗ-Чемпионата России по футболу в краснодарском дерби встречались «Кубань» и «Краснодар».\r\n\r\nМатч завершился победой гостей – 3:1.\r\n\r\nСчет в матче открыл Мельгарехо. Однако дальше забивали только игроки «Краснодара». Широков оформил дубль, а еще один мяч в активе Ари.',1,'2014-03-31 11:23:00'),(8,'Илья Шихалеев','ilya.shikhaleev@cpslabs.net','В матче 23-го тура СОГАЗ-Чемпионата России в Перми «Амкар» принимал «Зенит» и уступил со счетом 1:2.\r\n\r\nМаксим Канунников вывел хозяев поля вперед на 18-й минуте матча. На 49-й минуте Доменико Кришито сделал счет равным. Победный гол «Зенита» на 54-й минуте забил Александр Кержаков.',1,'2014-03-31 11:25:04'),(9,'Илья Шихалеев','ilya.shikhaleev@cpslabs.net','Привет',1,'2014-03-31 19:22:21');
/*!40000 ALTER TABLE `support` ENABLE KEYS */;
UNLOCK TABLES;

