INSERT INTO `synopsis` VALUES (24,'2014-03-09 12:32:56','Shablon konspekta.htm',''),(25,'2014-03-09 13:08:20','Shablon konspekta.htm',''),(26,'2014-03-09 14:49:44','Konspekt 1.htm',''),(27,'2014-03-17 11:50:46','Shablon konspekta 1.htm',''),(28,'2014-03-29 12:10:14','Konspekt 1.htm',''),(29,'2014-03-29 13:09:22','Konspekt 1.htm',''),(30,'2014-04-08 07:57:11','Konspekt 1.htm','\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nТема использования\r\nинфинитива достаточно сложна и объемна и требует особого внимания хотя бы\r\nпотому, что случаи его использования далеко не всегда совпадают со случаями\r\nиспользования неопределенной формы глагола в русском языке. Изучить эту тему\r\nпросто необходимо тем, кто хочет владеть английским языком на высоком уровне.\r\nИтак, формы инфинитива и случаи его использования.\r\n\r\nТема: Времена английского\r\nглагола\r\n\r\nУрок:\r\nУпотребление настоящего простого времени Present Simple\r\n\r\n1. Понятие о прямой и косвенной речи\r\n\r\n2. Вводные глаголы в прямой и косвенной речи\r\n\r\n3. Правила построения косвенной речи\r\n\r\n4. Вставка\r\n\r\n&nbsp;\r\n\r\n\r\n\r\n1. Понятие о прямой и косвенной речи\r\n\r\n\r\n\r\nПрямая речь – это точные слова, которые были кем-то произнесены. Мы берем\r\nпрямую речь в кавычки.\r\n\r\nПример:\r\n\r\n‘I’ll go to London’, she said.\r\n\r\n\r\n\r\nКосвенная речь передает точное значение сказанного, но не точно такими же\r\nсловами.\r\n\r\nПример:\r\n\r\nShe said she would go to London.\r\n\r\n&nbsp;\r\n\r\n\r\n\r\n2. Вводные глаголы в прямой и косвенной\r\nречи\r\n\r\n\r\n\r\nДля указания говорящего можно\r\nиспользовать глаголы say и tell как в прямой, так и в косвенной\r\nречи. Важно заметить, что после глагола tell обязательно идет прямое\r\nдополнение (e.g. told me). После глагола say можно не ставить прямое\r\nдополнение, но если мы его все-таки ставим, то после say в таком случае будет\r\nстоять частица to (e.g. said to me).\r\n\r\n\r\n\r\nПример:\r\n\r\nShe said, ‘I can’t\r\ndrive’. » She said (that) she couldn’t drive.\r\n\r\nShe said to me, ‘I\r\ncan’t drive’. » She said to me (that) she couldn’t drive.\r\n\r\nShe told me, ‘I\r\ncan’t drive’. » She told me (that) she couldn’t drive.\r\n\r\n\r\n\r\nСледующие выражения используются с глаголом say:\r\n\r\n1. say good morning /\r\nevening, etc.\r\n\r\n2. say something / nothing\r\n\r\n3. say a few words\r\n\r\n4. say so, etc.\r\n\r\n\r\n\r\nСледующие выражения используются с глаголом tell:\r\n\r\n1. tell the truth\r\n\r\n2. tell a lie\r\n\r\n3. tell somebody one’s name\r\n\r\n4. tell a story\r\n\r\n5. tell a secret\r\n\r\n6. tell somebody the way\r\n\r\n7. tell one from another,\r\netc.\r\n\r\n&nbsp;\r\n\r\n\r\n\r\n3. Правила построения косвенной\r\nречи\r\n\r\n\r\n\r\nЧтобы построить предложение в косвенной\r\nречи, нам нужен вводный глагол (say, tell, explain, etc.), за которым последует\r\nоборот с that, хотя в разговорной речи само слово that часто опускается.\r\n\r\n\r\n\r\nПример:\r\n\r\nHe said, ‘I feel sick’. »\r\nHe said (that) he felt sick.\r\n\r\nПритяжательные местоимения изменяются\r\nсогласно контексту.\r\n\r\n\r\n\r\nПример:\r\n\r\nHe said, ‘I’ll lend youmy laptop’. » He\r\nsaid (that) he would lend mehis laptop.\r\n\r\nРассмотрите таблицу изменений для\r\nобстоятельств времени и некоторых слов:\r\n\r\n\r\n\r\n\r\n \r\n  \r\n  Direct speech\r\n  \r\n  \r\n  Reported speech\r\n  \r\n \r\n \r\n  \r\n  tonight, today, this week / month / year\r\n  \r\n  \r\n  that night, that day, that week / month / year\r\n  \r\n \r\n \r\n  \r\n  now\r\n  \r\n  \r\n  then, at that time, at once, immediately\r\n  \r\n \r\n \r\n  \r\n  now\r\n  that\r\n  \r\n  \r\n  since\r\n  \r\n \r\n \r\n  \r\n  yesterday, last night / week / month / year\r\n  \r\n  \r\n  the day before, the previous night / week / month / year\r\n  \r\n \r\n \r\n  \r\n  tomorrow, next week / month / year\r\n  \r\n  \r\n  the following day / the day after, the following / next week /\r\n  month / year\r\n  \r\n \r\n \r\n  \r\n  ago\r\n  \r\n  \r\n  before\r\n  \r\n \r\n \r\n  \r\n  this\r\n  / these\r\n  \r\n  \r\n  that\r\n  / those\r\n  \r\n \r\n \r\n  \r\n  here\r\n  \r\n  \r\n  there\r\n  \r\n \r\n \r\n  \r\n  come\r\n  \r\n  \r\n  go\r\n  \r\n \r\n\r\n\r\n&nbsp;\r\n\r\nТаблица 2. Времена в косвенной речи\r\n\r\nМы не производим никаких изменений над\r\nвременами, когда:\r\n\r\n1. основное предложение выражает всегда\r\nправдивую истину, закон природы;\r\n\r\n2. основное предложение относится ко 2\r\nили 3 типу условных предложений;\r\n\r\n3. основное предложение выражает\r\nсожаление или пожелание (wish).\r\n\r\nПример:\r\n\r\n‘The Earth is a planet’, he\r\nsaid. → He said (that) the Earth is a planet.\r\n\r\n‘If you studied more, you’d\r\npass your test’, he said. → He said (that) if you studied more, you’d pass your test.\r\n\r\n‘I wish I were famous’, he\r\nsaid. → He said (that) I wish I were famous.\r\n\r\n\r\n\r\nЕсли вводный глагол стоит в одном из\r\nвремен группы Present или Future, в основном предложении не происходит никаких\r\nизменений во временах.\r\n\r\n\r\n\r\nПример:\r\n\r\n‘Nina can read’, she says. → She says that Nina\r\ncan read.\r\n\r\n\r\n\r\nКогда мы говорим о неком факте, который\r\nвсе еще актуален или правдив на настоящий момент, мы можем менять, а можем и не\r\nменять грамматические времена основного предложения при переводе его в\r\nкосвенную речь.\r\n\r\nГрамматические времена меняются, когда\r\nмы говорим о чем-то, что уже не актуально или неверно на момент речи.\r\n\r\n&nbsp;\r\n\r\n\r\n\r\n4. Вставка\r\n\r\n\r\n\r\nRephrase the following\r\nsentences as in the example:\r\n\r\n1. We spoke quietly because\r\nwe didn’t want to wake the baby.\r\n\r\ne.g. We spoke quietly so as\r\nnot to wake the baby.\r\n\r\n2. Although he was ill, he\r\nstill went to work.\r\n\r\n3. What a lovely house!\r\n\r\n4. How happy you look!\r\n\r\n5. This is the university I\r\nwent to.\r\n\r\n6. You run so fast!\r\n\r\n7. She has such lovely\r\neyes!\r\n\r\n8. What a beautiful dress!\r\n\r\n9. Despite being tired, she\r\nstill watched the late film!\r\n\r\n10. I didn’t tell you\r\nbecause I thought you’d be upset.\r\n\r\n\r\n\r\n\r\n\r\n\r\n');
